import React, { useEffect, useState } from 'react'

import styles from './Projects.module.sass'

import axios from 'axios'

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Button from 'react-bootstrap/Button'
import Badge from 'react-bootstrap/Badge'

function Projects () {
  const [projects, setProjects] = useState('')

  useEffect(() => {
    axios
      .get('https://api.github.com/users/brandonpessman/repos')
      .then(data => {
        setProjects(data)
      })
  }, [])

  return (
    <div>
      <Container>
        <h1
          style={{ fontSize: '28px', fontWeight: '600', marginBottom: '25px' }}
        >
          Projects
        </h1>
        <Row>
          {projects.map(project => {
            return (
              <Col className={styles.projectContainer} sm={4}>
                <h1 className={styles.header1}>Test</h1>
                <h2 className={styles.header2}>Test Description</h2>
                <Button className={styles.sourceButton} variant='primary'>
                  Source Code
                </Button>{' '}
                <Button className={styles.liveButton} variant='primary'>
                  Live Demo
                </Button>
                <div className={styles.languages}>
                  <Badge className={styles.languageBadge} variant='primary'>
                    C++
                  </Badge>
                </div>
              </Col>
            )
          })}
        </Row>
      </Container>
    </div>
  )
}

export default Projects
